import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import axios from 'axios';
import './Navbar.css';

function Navbar() {
  const [isDarkMode, setIsDarkMode] = useState(true);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [showDropdown, setShowDropdown] = useState(false);
  const [categorias, setCategorias] = useState([]);
  const location = useLocation();

  useEffect(() => {
    setIsMenuOpen(false);
    setShowDropdown(false);
  }, [location]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/categorias/')
      .then(res => setCategorias(res.data))
      .catch(err => console.error("Error cargando categor√≠as:", err));
  }, []);

  const toggleDarkMode = () => {
    setIsDarkMode(!isDarkMode);
    document.body.classList.toggle('light-theme', !isDarkMode);
  };

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);
  const closeMenu = () => {
    setIsMenuOpen(false);
    setShowDropdown(false);
  };

  const toggleDropdown = () => setShowDropdown(!showDropdown);
  const isActiveLink = (path) => location.pathname === path;

  return (
    <nav className="custom-navbar">
      <div className="navbar-container">
        {/* Logo */}
        <Link className="navbar-logo" to="/" onClick={closeMenu}>
          <img src="https://i.postimg.cc/YCZg4n8g/LOGO-ELECTRICOS-removebg-preview.png" alt="Logo" />
        </Link>

        <button className={`mobile-toggle ${isMenuOpen ? 'active' : ''}`} onClick={toggleMenu}>
          <span></span><span></span><span></span>
        </button>

        <div className={`nav-menu ${isMenuOpen ? 'active' : ''}`}>
          <Link className={`nav-link ${isActiveLink('/quienes-somos') ? 'active' : ''}`} to="/quienes-somos" onClick={closeMenu}>
            Quienes Somos
          </Link>

          {/* Dropdown din√°mico */}
          <div className="nav-dropdown">
            <button className={`nav-link dropdown-btn ${isActiveLink('/categorias') ? 'active' : ''}`} onClick={toggleDropdown}>
              Categor√≠as <span className={`dropdown-arrow ${showDropdown ? 'active' : ''}`}>‚ñº</span>
            </button>
            {showDropdown && (
              <div className="dropdown-content">
                {categorias.map((cat) => (
                  <Link
                    key={cat.id}
                    to={`/categorias/${cat.nombre.toLowerCase()}`}
                    onClick={closeMenu}
                  >
                    {cat.nombre}
                  </Link>
                ))}
              </div>
            )}
          </div>

          <Link className={`nav-link ${isActiveLink('/novedades') ? 'active' : ''}`} to="/novedades" onClick={closeMenu}>
            Novedades
          </Link>

          <Link className={`nav-link ${isActiveLink('/contacto') ? 'active' : ''}`} to="/contacto" onClick={closeMenu}>
            Contacto
          </Link>
        </div>

        <div className="nav-actions">
          <Link to="/productos" className={`action-icon cart-icon ${isActiveLink('/productos') ? 'active' : ''}`} onClick={closeMenu}>
            <img src="https://cdn-icons-png.flaticon.com/512/8146/8146003.png" alt="Carrito" style={{ width: '50px', height: '40px' }} />
          </Link>

          <Link to="/perfil" className={`action-icon profile-icon ${isActiveLink('/perfil') ? 'active' : ''}`} onClick={closeMenu}>
            <div className="profile-circle" style={{ width: '60px', height: '60px', overflow: 'hidden', borderRadius: '50%' }}>
              <img
                src="https://static.vecteezy.com/ti/vetor-gratis/p3/7407996-user-icon-person-icon-client-symbol-login-head-sign-icon-design-vetor.jpg"
                alt="Usuario"
                style={{ width: '100%', height: '100%', objectFit: 'cover' }}
              />
            </div>
          </Link>

          <button className="mode-toggle-btn" onClick={toggleDarkMode}>
            <span className="mode-icon">{isDarkMode ? '‚òÄÔ∏è' : 'üåô'}</span>
            <span className="mode-text">Modo {isDarkMode ? 'Claro' : 'Oscuro'}</span>
          </button>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
